pragma solidity ^0.4.21;

import "./zeppelin/StandardToken.sol";
import "./zeppelin/Ownable.sol";
import "./zeppelin/CappedCrowdsale.sol";
import "./zeppelin/RefundableCrowdsale.sol";
import "./zeppelin/MintableToken.sol";


contract PowerPiperCrowdsaleToken is MintableToken {

    string public constant name = "PowerPiperCrpowdsaleToken";
    string public constant symbol = "PWP";

    function PowerPiperCrowdsaleToken(uint256 _totalSupply) public {
        balances[msg.sender] = _totalSupply;
        emit Transfer(address(0), msg.sender, _totalSupply);
    }

}

contract PowerPiperCrowdsale is CappedCrowdsale, RefundableCrowdsale {

    uint256 public constant totalSupply = 1000000 * 10 ** 3;

    function PowerPiperCrowdsale(uint256 _startTime, uint256 _endTime, uint256 _rate, uint256 _cap, uint256 _goal, address _wallet, MintableToken _token) public
        CappedCrowdsale(_cap)
        FinalizableCrowdsale()
        RefundableCrowdsale(_goal)
        TimedCrowdsale(_startTime, _endTime)
        Crowdsale(_rate, _wallet, _token)
    {
        require(_goal <= _cap);
    }

    /*function createTokenContract(uint256 totalSupply) internal returns (MintableToken) {
        return new PowerPiperCrowdsaleToken(totalSupply);
    }*/

    function buyTokens(address _beneficiary) public payable {
        uint256 _weiAmount = msg.value;
        require(_beneficiary != address(0));
        require(_weiAmount != 0);

        uint256 tokens = _weiAmount.mul(rate);

        weiRaised = weiRaised.add(_weiAmount);

        require(token.transfer(_beneficiary, tokens));

        emit TokenPurchase(msg.sender, _beneficiary, _weiAmount, tokens);

        _forwardFunds();
    }

}
